package com.example.fishingapp;

import androidx.test.ext.junit.runners.AndroidJUnit4;

import com.example.fishingapp.models.EntityFish;
import com.example.fishingapp.models.FishModel;
import com.example.fishingapp.views.MyApplication;

import org.junit.Before;
import org.junit.Test;
import org.junit.runner.RunWith;

import java.util.ArrayList;

import static org.junit.Assert.assertEquals;

@RunWith(AndroidJUnit4.class)

public class modelTest {

        private FishModel model;
        private EntityFish fish;
        private String id;

        @Before
        public void setUp(){
            model = new FishModel();
            fish = new EntityFish();
            fish.setId("F1");
            fish.setDate("21/02/2021");
            fish.setWeight("2,5");
            fish.setCaptures("Una");
            fish.setFisher("andrea");
            fish.setInformation("he pescado una carpta con modalidad a fondo");
            fish.setImage("");
            fish.setSex("hembra");
            fish.setLoose(true);
            model.insert(fish);
            id = model.getAllSummarize().get(0).getId();
        }

        @Test
        public void insertFish(){
            assertEquals(true, this.model.insert(this.fish));
        }

        @Test
        public void updateFish(){
            this.fish.setLoose(false);
            this.fish.setFisher("alvaro");
            assertEquals(true, this.model.updateFish(this.fish));
        }

        @Test
        public void deleteFish(){
            assertEquals(true, this.model.deleteFish(fish));
        }

        @Test
        public void getAllFish(){
            assertEquals(id, this.model.getAllSummarize().get(0).getId());
        }

        @Test
        public void getFishById(){
            assertEquals(id, this.model.getById(id).getId());
            assertEquals("carpa", this.model.getById(id).getFish());
        }


        @Test
        public void getAllSex(){
            ArrayList<String> sex = new ArrayList<>();
            sex.add("h");
            sex.add("hembra");
            assertEquals(sex, this.model.getAllSexs());
        }

        @Test
        public void fishFilter(){
            ArrayList<EntityFish> fishs = new ArrayList<>();
            fishs.add(this.fish);

                assertEquals(0, this.model.getItemsByAllCriterion("Hembra", "20/10/2020", "Tiburon").size());
                assertEquals(0, this.model.getItemsByFish("Sardina").size());
                assertEquals(0, this.model.getItemsBySex("Macho").size());
                assertEquals(0, this.model.getItemsByDate("31/01/2021").size());

        }
}